import { Button, Col, Container, Form, FormGroup, Input, Label, Row } from "reactstrap";

const register = () => {
  return (
    <Container>
      <Row>
        <Col>
        <div className="paper">
          <div>
            <h2>ユーザー登録</h2>
          </div>
        </div>
        <section className="wrapper">
          <Form>
            <fieldset>
              <FormGroup>
                <Label>ユーザー名:</Label>
                <Input 
                  type="text" 
                  name="username" 
                  style={{height:50, fontSize:"1.2rem"}} 
                />
              </FormGroup>
              <FormGroup>
                <Label>メールアドレス: </Label>
                <Input 
                  type="email" 
                  name="email" 
                  style={{height:50, fontSize:"1.2rem"}} 
                />
              </FormGroup>
              <FormGroup>
                <Label>パスワード:</Label>
                <Input 
                  type="password" 
                  name="password" 
                  style={{height:50, fontSize:"1.2rem"}} 
                />
              </FormGroup>
              <span>
                <a href="">
                  <small>パスワードをお忘れですか？</small>
                </a>
              </span>
              <Button style={{float: "right", width:120}} color="primary">
                登録
              </Button>
            </fieldset>
          </Form>
        </section>
        </Col>
      </Row>
      <style jsx>
         {
           `
            .paper {
              text-align: center;
              margin-top: 50px;
            }
            .header {
              width: 100%;
              margin-bottom: 30px;
            }
            .wrapper {

            }
           `
         }

      </style>
    </Container>
  );
}

export default register;
